import styled from 'styled-components'

export const Container = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: space-around;
    width: 1.5rem;
    height: 1.5rem;
`

export const Bar = styled.div`
    display: block;
    height: 4px;
    width: 100%;
    background-color: #000000; 

`
